measurements.description:
Eleven flowers and 14 buds on one arching 106-cm inflorescence; 
   dorsal sepal hooded, lanceolate, light yellow, densely spotted burgundy;
   lateral sepals and petals lanceolate, yellow, spotted, blotched and diffused burgundy;
   lip white overlaid yellow basally, spotted burgundy;
   column chartreuse, spotted burgundy, anther cap white;
   substance average; texture matte.
